import React from "react";

function Login() {
  return (
    <>
      <div className="container-fluid">
        <div className="row"></div>
        <form action="">
          <h1>login from</h1>
          <input type="text" className="" placeholder="Email" />
          <input type="password" placeholder="Password" />
        </form>
      </div>
    </>
  );
}

export default Login;
